import styled from "@emotion/styled";

const travelList = [
  {
    country: "오사카",
    desc: "일본에서 세 번째로 큰 도시로 맛있는 음식과 활기찬 분위기가 특징이에요.",
  },
  {
    country: "도쿄",
    desc: "도쿄는 일본의 수도이자 독특한 매력으로 전 세계에서 사랑받는 대도시입니다",
  },
  {
    country: "방콕",
    desc: "화려한 사원과 쇼핑몰이 유명하고, 물가도 저렴한 편이에요.",
  },
];

function App() {
  return (
    <Layout>
      <Container>
        <Header>
          <Logo src="img/logo.svg" alt="로고" />
          <UtilsBox>
            <IconWithMargin src="/img/alarm.svg" alt="알람" />
            <Icon src="/img/mypage.svg" alt="알람" />
          </UtilsBox>
        </Header>
        <Body>
          <Wrapper1>
            <Title>지금 가기 좋아요</Title>
            <ImageBox>
              <Image />
              <Desc>
                오사카는 일본에서 세 번째로 큰 도시로 맛있는 음식과 활기찬
                분위기가 특징이에요.
              </Desc>
            </ImageBox>
          </Wrapper1>
        </Body>
      </Container>
    </Layout>
  );
}

export default App;

const Layout = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`;

const Container = styled.div`
  width: 380px;
  height: 100vh;
  padding: 20px;
  background-color: aliceblue;
`;

const Header = styled.div`
  display: flex;
  justify-content: space-between;
  /* background-color: aqua; */
  margin-bottom: 20px;
`;

const UtilsBox = styled.div`
  display: flex;
`;

const Body = styled.div`
  /* height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 30px; */
`;

const Logo = styled.img``;

const Icon = styled.img``;

const IconWithMargin = styled(Icon)`
  margin-right: 15px;
`;

const Wrapper1 = styled.div``;

const Title = styled.div`
  font-size: 20px;
  font-weight: 800;
`;

const ImageBox = styled.div`
  width: 200px;
`;

const Image = styled.img`
  width: 200px;
  height: 120px;
  background-color: gray;
  border-radius: 16px;
`;

const Desc = styled.div`
  font-size: 10px;
`;
